import { ColumnFilter } from "./ColumnFilter";

export const COLUMNS = [
    {
        Header: 'Артикуль',
        accessor: 'Артикуль',
        filter: ColumnFilter
        
    },
    {
        Header: 'Наименование',
        accessor: 'Наименование',
        filter: ColumnFilter
        
    },
    {
        Header: 'Группа товара',
        accessor: 'Группа_товара',
        filter: ColumnFilter
    },
    {
        Header: 'Поставщик',
        accessor: 'Поставщик',
        filter: ColumnFilter
    },
    {
        Header: 'Типоразмер',
        accessor: 'Типоразмер',
        filter: ColumnFilter
    },
    {
        Header: 'Модель',
        accessor: 'Модель',
        filter: ColumnFilter
    },
    {
        Header: 'Цена',
        accessor: 'Цена',
        filter: ColumnFilter
    }
]
